const Shops = (onShop, shops = []) => {
  return (
    <div>
      <p onClick={() => onShop('')}>All shops</p>
      {shops.map(item => {
        return (
          <p key={item.index} onClick={() => onShop(item)}>
            {' '}
            {item}
          </p>
        );
      })}
    </div>
  );
};

export default Shops;
